import Popular from "../components/Popular";
import Ensaladas from "../components/Ensaladas";
import Pollos from "../components/Pollos";
import Postres from "../components/Postres";
import '..App';

import React from 'react';

function Home() {
  return (
    <div className="menu-container">
      <div className="menu-item">Ensaladas</div>
      <div className="menu-item">Postres</div>
      <div className="menu-item">Populares</div>
      <div className="menu-item">Pollos</div>
    </div>
  );
}

export default Home;
